            cursor.execute("INSERT INTO QMS_severitylevelmaster (name,created_by_id,updated_by_id,created_on,updated_on,is_active)"
                           "VALUES (%s,%s,%s,%s,%s,%s)", (ele, 471, 471, now, now, 1))
